#book {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: space-between;
    height: 90vh;
    padding: 1em;
    form {
        height: 80vh;
        width: 90vw;
        font-size: 12pt;
        text-align: center;
        label {
            display: none;
        }
        input[type=text]{
            font-family: 'Slabo 27px';
            padding: 1vw;
            margin: 1vw;
            width: 88vw;
        }
        textarea {
            @extend input[type=text];
            height: 25vh;
            resize: vertical;
        }
        input[type=submit] {
            font-family: 'Slabo 27px';
            padding: 1em;
            border-style: none;
            outline: none;
            background: $green;
            cursor: pointer;
        }
        #sent {
            color: $green;
            opacity: 0;
        }
    }
}

@media only screen and (min-width: 500px) {
    #message {
        form {
        width: 60vw;
            input[type=text], 
            textarea {
            width: 58vw;
            }
        }
    }
}

